	   if(p&&(typeof p!='object')) s = p;      // (2)
	   if(p&&p.round==true) { round = true, r = v&&v.length?(v[0]+v[1]+v[2])/30:s/10}
	   if(p&&p.radius) { round = true, r = p.radius; }
