	function lookup(ix,v) {
	   var r = 0;
	   for(var i=0; i<v.length; i++) {
	      var a0 = v[i];
	      if(a0[0]>=ix) {
	         i--;
	         a0 = v[i];
	         var a1 = v[i+1];
	         var m = 0;
	         if(a0[0]!=a1[0]) {
	            m = abs((ix-a0[0])/(a1[0]-a0[0]));
	         }
	         //echo(">>",i,ix,a0[0],a1[0],";",m,a0[1],a1[1]);
	         if(m>0) {
	            r = a0[1]*(1-m)+a1[1]*m;
	         } else {
	            r = a0[1];
	         }
	         return r;
	      } 
	   }
	   return r;
	}
